import { fetchCategoriesList } from "../store/slices/categoriesSlice";


const CategoryDropdown = () => {
const dispatch = useDispatch();
const listCategory = useSelector(state=>state.categories.listCategory.entities);
console.log("List category: ", listCategory);

const listCategoryJSX = listCategory.map((category)=>{
  return <Dropdown.Item
  onClick={() => {}}
>
{category.title}</Dropdown.Item>
})
useEffect(()=>{
  dispatch(fetchCategoriesList());
},[])

return <Dropdown
  title='Category'
>
  {listCategoryJSX}
  <Dropdown.Item
    onClick={() => {}}
  >
    Item 1
  </Dropdown.Item>
  <Dropdown.Item>
